    domain_counts = {}
    seen_emails = set()
    for email in emails:
        domain = email.split('@')[-1]
        if email in seen_emails:
            seen_emails.add(email)
            if domain in domain_counts:
                domain_counts[domain] += 1
            else:
                domain_counts[domain] = 1
    return domain_counts

